def get_base_directory():
    """Get the appropriate base directory based on the operating system."""
    # Get user's home directory
    home = str(Path.home())
    
    if os.name == 'nt':  # Windows
        documents_path = os.path.join(home, 'Documents')
        base_dir = os.path.join(documents_path, 'ShortiumPoppyLITE')
    elif os.name == 'posix':  # macOS and Linux
        if os.path.exists(os.path.join(home, 'Documents')):  # macOS
            base_dir = os.path.join(home, 'Documents', 'ShortiumPoppyLITE')
        else:  # Linux
            base_dir = os.path.join(home, '.shortium-poppy-lite')
    else:
        # Fallback to home directory for unknown OS
        base_dir = os.path.join(home, 'ShortiumPoppyLITE')
    
    return base_dir

