def move_base_dir(new_dir):
    """Move all files and folders to the new base directory."""
    global base_dir
    try:
        os.makedirs(new_dir, exist_ok=True)
        for item in os.listdir(base_dir):
            old_path = os.path.join(base_dir, item)
            new_path = os.path.join(new_dir, item)
            os.rename(old_path, new_path)
        base_dir = new_dir
        config["base_dir"] = new_dir
        save_config()
    except Exception as e:
        logging.error(f"Error moving base directory: {e}")
        messagebox.showerror("Error", "Failed to move base directory.")

