def get_video_thumbnail(video_path):
    """Generate thumbnail from video with improved sizing."""
    cap = cv2.VideoCapture(video_path)
    ret, frame = cap.read()
    cap.release()
    
    if ret:
        # Get video dimensions
        height, width = frame.shape[:2]
        
        # Define preview frame dimensions
        PREVIEW_WIDTH = 200
        PREVIEW_HEIGHT = 200
        
        # Calculate aspect ratio
        aspect_ratio = width / height
        
        if aspect_ratio > 1:  # Landscape video
            new_width = PREVIEW_WIDTH
            new_height = int(PREVIEW_WIDTH / aspect_ratio)
        else:  # Portrait video
            new_height = PREVIEW_HEIGHT
            new_width = int(PREVIEW_HEIGHT * aspect_ratio)
        
        # Resize frame maintaining aspect ratio
        frame = cv2.resize(frame, (new_width, new_height))
        
        # Create a black background of fixed size
        background = np.zeros((PREVIEW_HEIGHT, PREVIEW_WIDTH, 3), dtype=np.uint8)
        
        # Calculate position to center the frame
        y_offset = (PREVIEW_HEIGHT - new_height) // 2
        x_offset = (PREVIEW_WIDTH - new_width) // 2
        
        # Place the frame on the background
        background[y_offset:y_offset+new_height, 
                  x_offset:x_offset+new_width] = frame
        
        # Convert BGR to RGB
        background = cv2.cvtColor(background, cv2.COLOR_BGR2RGB)
        
        # Convert to PhotoImage
        image = Image.fromarray(background)
        return ImageTk.PhotoImage(image)

