def validate_time_char(P):
    """Validate time entry input."""
    # Remove existing colons for validation
    text = P.replace(":", "")
    # Check if input would exceed 6 digits
    if len(text) > 6:
        return False
    # Allow only numbers
    return text == "" or text.isdigit()

