def update_quota_label(reset=False):
    """Update quota and reset it at 12 PM UAE time."""
    global remaining_quota
    
    # Get current time in UAE timezone
    uae_tz = timezone(timedelta(hours=4))
    uae_time = datetime.now(uae_tz)
    
    # Get user's local timezone
    local_tz = get_localzone()
    local_time = datetime.now(local_tz)
    
    # Calculate when UAE time is 12 PM in user's local time
    uae_noon = uae_time.replace(hour=12, minute=0, second=0, microsecond=0)
    local_reset_time = uae_noon.astimezone(local_tz)
    
    # Check if it's time to reset
    if reset or (local_time.hour == local_reset_time.hour and 
                local_time.minute == local_reset_time.minute):
        remaining_quota = TOTAL_QUOTA
        save_quota()
    
    quota_label.config(
        text=f"Remaining Quota: {remaining_quota}",
        fg="#69ff39" if remaining_quota > 5000 else "orange" if remaining_quota > 2000 else "red",
    )


def save_quota():
    """Save the remaining quota to a file."""
    quota_data = {"remaining_quota": remaining_quota, "last_reset_date": str(datetime.now().date())}
    with open(os.path.join(YOUTUBE_FOLDER, "quota.json"), "w") as f:
        json.dump(quota_data, f)

def load_quota():
    """Load the remaining quota from a file."""
    global remaining_quota
    quota_path = os.path.join(YOUTUBE_FOLDER, "quota.json")
    if os.path.exists(quota_path):
        with open(quota_path, "r") as f:
            quota_data = json.load(f)
            last_reset_date = quota_data.get("last_reset_date")
            today_date = str(datetime.now().date())
            if last_reset_date != today_date:
                remaining_quota = TOTAL_QUOTA  # Reset quota for a new day
            else:
                remaining_quota = quota_data.get("remaining_quota", TOTAL_QUOTA)
    else:
        remaining_quota = TOTAL_QUOTA
    save_quota()

def deduct_quota(amount=UPLOAD_COST):
    """Deduct quota and save the updated value."""
    global remaining_quota
    remaining_quota -= amount
    save_quota()

