def upload_limited_videos(limit=1):
    """Uploads a limited number of videos from the folder."""
    global uploaded_videos
    uploaded_count = 0  # Counter for uploaded videos

    for file_name in os.listdir(VIDEO_FOLDER):
        file_path = os.path.join(VIDEO_FOLDER, file_name)

        # Only process video files that are not flagged
        if (
            os.path.isfile(file_path)
            and file_name.lower().endswith(('.mp4', '.mov'))
            and not is_video_uploaded(file_name)  # Check by name, not full path
        ):
            upload_video(file_path)  # Upload the video
            uploaded_count += 1

            # Stop after reaching the upload limit
            if uploaded_count >= limit:
                break

    # Handle cases where no new videos are available for upload
    if uploaded_count == 0:
        log_message("No unflagged videos found to upload.")


def set_upload_limit():
    """Set the upload limit from user input."""
    global upload_limit
    try:
        upload_limit = int(limit_entry.get())
        if upload_limit <= 0:
            raise ValueError
        log_message(f"Upload limit set to {upload_limit}.")  # Simplified feedback
    except ValueError:
        messagebox.showerror("Invalid Input", "Enter a positive number for the upload limit.")

# Validate time format
def validate_time_format(time_string):
    try:
        time.strptime(time_string, "%H:%M:%S")
        return True
    except ValueError:
        return False


def upload_video_with_quota_check(file_path):
    """Uploads a video but checks the quota before proceeding."""
    global remaining_quota
    if remaining_quota <= 0:
        log_message("Quota exceeded. Cannot upload any more videos.")
        return uploaded_videos  # Return unchanged list if quota is exhausted

    # Proceed with the upload if quota is available
    return upload_video(file_path)


def is_video_uploaded(file_name):
    """Checks if a video is already in the uploaded videos list."""
    return file_name in uploaded_videos  # Compare against video names, not paths

