def add_custom_schedule(schedule_time, video_path):
    """Add a custom schedule for a specific video."""
    try:
        custom_schedule_path = os.path.join(YOUTUBE_FOLDER, "custom_schedules.json")
        schedule = {"time": schedule_time, "video_path": video_path}
        
        if not os.path.exists(video_path):
            messagebox.showerror("Error", "Video file does not exist.")
            return

        # Append the schedule to the JSON file
        if os.path.exists(custom_schedule_path):
            with open(custom_schedule_path, "r") as file:
                schedules = json.load(file)
        else:
            schedules = []

        # Prevent duplicate schedules for the same time
        if any(s["time"] == schedule_time for s in schedules):
            messagebox.showerror("Error", "A schedule already exists for this time.")
            return

        schedules.append(schedule)
        with open(custom_schedule_path, "w") as file:
            json.dump(schedules, file, indent=4)

        log_message(f"Custom schedule added for {schedule_time}.", "INFO")
        update_schedule_box()
    except Exception as e:
        log_message(f"Error adding custom schedule: {str(e)}", "ERROR")

