def add_schedule():
    """Add a new schedule with validation."""
    if not CLIENT_SECRETS_FILE:
        log_message("Please select and authorize client secrets file first!", "WARNING")
        messagebox.showwarning("Warning", "Please select and authorize client secrets file before adding schedules!")
        return
        
    time = time_entry.get()
    if validate_time_format(time):
        conn = sqlite3.connect(DATABASE_FILE)
        cursor = conn.cursor()
        
        # Check if schedule already exists
        cursor.execute("SELECT id FROM schedules WHERE time = ?", (time,))
        if cursor.fetchone():
            log_message("Schedule already exists for this time!", "WARNING")
            conn.close()
            return
            
        cursor.execute("INSERT INTO schedules (time, is_active) VALUES (?, 1)", (time,))
        conn.commit()
        conn.close()
        update_schedule_box()
        time_entry.delete(0, tk.END)
        log_message(f"Schedule added for {time} (runs daily)", "INFO")
    else:
        log_message("Invalid time format!", "ERROR")
        messagebox.showerror("Invalid Time", "Please enter a valid time in HH:MM:SS format.")

