# Fix for Scheduled Uploads
def check_times():
    """Continuously checks schedules and triggers uploads."""
    while True:
        try:
            current_time = datetime.now().strftime("%H:%M:%S")

            # Check regular schedules
            if CLIENT_SECRETS_FILE and VIDEO_FOLDER:
                conn = sqlite3.connect(DATABASE_FILE)
                cursor = conn.cursor()
                cursor.execute("SELECT id, time FROM schedules WHERE is_active = 1")
                schedules = cursor.fetchall()
                conn.close()

                for schedule_id, schedule_time in schedules:
                    if schedule_time == current_time:
                        threading.Thread(target=lambda: upload_limited_videos(limit=1), daemon=True).start()

                # Check custom schedules
                custom_schedules = load_custom_schedules()
                for schedule in custom_schedules:
                    if schedule["time"] == current_time:
                        def upload_custom():
                            try:
                                video_path = schedule["video_path"]
                                if os.path.exists(video_path):
                                    upload_video(video_path)
                            except Exception as e:
                                log_message(f"Error in custom upload: {str(e)}", "ERROR")
                        
                        threading.Thread(target=upload_custom, daemon=True).start()

        except Exception as e:
            log_message(f"Error in schedule check: {str(e)}", "ERROR")

        time.sleep(1)

def start_upload_threaded():
    """Starts the upload process in a separate thread to prevent UI lag."""
    def upload_task():
        try:
            log_message("Starting upload...", "INFO")
            upload_limited_videos(limit=upload_limit)
            log_message("Upload completed successfully.", "INFO")
        except Exception as e:
            log_message(f"Error during upload: {str(e)}", "ERROR")

    threading.Thread(target=upload_task, daemon=True).start()


