def upload_video(file_path):
    """Upload a video with the appropriate template."""
    global uploaded_videos, remaining_quota

    video_name = os.path.basename(file_path)
    if video_name in uploaded_videos:
        log_message(f"Video {video_name} already uploaded. Skipping.", "INFO")
        return

    # Check if the video is assigned to a template
    templates = load_templates()
    assigned_template = None
    for template in templates:
        if "assigned_videos" in template and file_path in template["assigned_videos"]:
            assigned_template = template
            break

    # Use the assigned template or the selected template
    if assigned_template:
        title = assigned_template["title"]
        description = assigned_template["description"]
        tags = assigned_template["tags"].split(",")
    elif selected_template:
        title = selected_template["title"]
        description = selected_template["description"]
        tags = selected_template["tags"].split(",")
    else:
        log_message("No template selected. Please select or assign a template first.", "ERROR")
        return

    youtube = get_authenticated_service()

    try:
        request_body = {
            "snippet": {
                "title": title,
                "description": description,
                "tags": tags,
                "categoryId": "22",
            },
            "status": {"privacyStatus": "public"},
        }

        media = MediaFileUpload(file_path, chunksize=1024 * 1024, resumable=True)
        request = youtube.videos().insert(part="snippet,status", body=request_body, media_body=media)
        response = None

        while response is None:
            status, response = request.next_chunk()
            if status:
                log_message(f"Uploading... {int(status.progress() * 100)}%", "INFO")

        uploaded_videos.append(video_name)
        save_uploaded_videos()
        deduct_quota(UPLOAD_COST)
        root.after(0, update_video_preview)
        root.after(0, update_quota_label)
        log_message(f"Upload successful: {video_name}", "SUCCESS")
    except Exception as e:
        log_message(f"Error uploading video {video_name}: {str(e)}", "ERROR")
        return uploaded_videos

