def log_message(message, log_type="INFO"):
    """
    Log a message with color coding based on type.
    Types: SUCCESS (green), ERROR (red), WARNING (orange), INFO (white)
    """
    log_text.config(state=tk.NORMAL)
    
    # Define colors for different log types
    log_colors = {
        "SUCCESS": "#69ff39",  # Green
        "ERROR": "red",    # Red
        "WARNING": "#FFA500",  # Orange
        "INFO": "#62e7ff"      # White
    }
        
    # Format the log message with timestamp and color
    color = log_colors.get(log_type, "#FFFFFF")
    log_text.tag_configure(log_type, foreground=color)
    
    # Insert the log message with appropriate color tag
    log_text.insert(tk.END, f"►", log_type)
    log_text.insert(tk.END, f"{message}\n", log_type)
    
    log_text.see(tk.END)
    log_text.config(state=tk.DISABLED)
    
    # Show notification if enabled
    if config.get("show_notifications", True):
        if log_type in ["ERROR", "SUCCESS"]:
         notification.notify(
            title=f"ShortiumPoppyLITE - {log_type}",
            message=message,
            app_icon=None,  # You can add an icon path here
            timeout=5
        )

