class SystemTray:
    def __init__(self, root):
        self.root = root
        self.icon = None
        self.is_running = False
        self.create_tray_icon()

    def create_tray_icon(self):
     try:
        # Decode the base64 string and load the image
        icon_data = base64.b64decode(tray_icon_base64)
        icon_image = Image.open(BytesIO(icon_data))

        # Create a tray menu
        menu = pystray.Menu(
            pystray.MenuItem('Show', self.show_window),
            pystray.MenuItem('Exit', self.quit_application)
        )

        # Stop existing icon if any
        if hasattr(self, 'icon') and self.icon is not None:
            self.icon.stop()

        # Create and start the tray icon
        self.icon = pystray.Icon("ShortiumPoppyLITE", icon_image, "ShortiumPoppyLITE", menu)

     except Exception as e:
        log_message(f"Error creating system tray icon: {str(e)}", "ERROR")
        self.icon = None
        
    def show_window(self, icon, item):
        try:
            self.is_running = False
            if self.icon:
                self.icon.stop()
            self.root.after(0, self.root.deiconify)
            self.root.after(0, self.root.lift)
        except Exception as e:
            log_message(f"Error showing window: {str(e)}", "ERROR")
            self.root.deiconify()
        
    def quit_application(self, icon, item):
        try:
            self.is_running = False
            if self.icon:
                self.icon.stop()
            save_uploaded_videos()
            save_config(config)
            self.root.quit()
        except Exception as e:
            log_message(f"Error quitting application: {str(e)}", "ERROR")
            self.root.quit()
    
    def run_icon(self):
        """Run the system tray icon in a separate thread."""
        if self.icon and not self.is_running:
            try:
                self.is_running = True
                self.icon.run()
            except Exception as e:
                log_message(f"Error running system tray: {str(e)}", "ERROR")
                self.root.deiconify()
                self.is_running = False
        
    def minimize_to_tray(self):
        try:
            if not self.icon or not self.is_running:
                self.create_tray_icon()
            
            if self.icon:
                self.root.withdraw()
                # Start the icon in a separate thread
                threading.Thread(target=self.run_icon, daemon=True).start()
            else:
                log_message("System tray not available, minimizing window instead", "WARNING")
                self.root.iconify()
        except Exception as e:
            log_message(f"Error minimizing to tray: {str(e)}", "ERROR")
            self.root.iconify()

def on_close():
    """Handle window close event."""
    try:
        if config.get("minimize_to_tray", False):
            # Start a background thread for checking schedules
            if not hasattr(on_close, 'background_thread'):
                on_close.background_thread = threading.Thread(target=background_process, daemon=True)
                on_close.background_thread.start()
            system_tray.minimize_to_tray()
        else:
            save_uploaded_videos()
            save_config(config)
            root.destroy()
    except Exception as e:
        log_message(f"Error handling window close: {str(e)}", "ERROR")
        root.destroy()

def background_process():
    """Handle background processing of schedules and uploads."""
    while True:
        try:
            # Check schedules and process uploads
            current_time = datetime.now().strftime("%H:%M:%S")
            
            if CLIENT_SECRETS_FILE and VIDEO_FOLDER:
                # Check regular schedules
                conn = sqlite3.connect(DATABASE_FILE)
                cursor = conn.cursor()
                cursor.execute("SELECT id, time FROM schedules WHERE is_active = 1")
                schedules = cursor.fetchall()
                conn.close()
                
                for schedule_id, schedule_time in schedules:
                    if schedule_time == current_time:
                        threading.Thread(target=lambda: upload_limited_videos(limit=1), daemon=True).start()
                
                # Check custom schedules
                custom_schedules = load_custom_schedules()
                for schedule in custom_schedules:
                    if schedule["time"] == current_time:
                        video_path = schedule["video_path"]
                        if os.path.exists(video_path):
                            threading.Thread(target=lambda: upload_video(video_path), daemon=True).start()
                
                # Update quota at UAE noon
                update_quota_label()
                
            time.sleep(1)
        except Exception as e:
            log_message(f"Error in background process: {str(e)}", "ERROR")
            time.sleep(5)  # Wait before retrying

